import React from "react";
import SignInForm from "../components/SignInForm";
import Input from "../components/Input";

const SignIn = () => {
  return (
    <div className="signin-page">
      <form>
        <Input
          title="Email"
          type="email"
          id="email"
          name="email"
          htmlfor="email"
        />
      </form>
    </div>
  );
};

export default SignIn;
